INSERT INTO `PostTemplates` (`templateId`, `templateText`, `programId`) VALUES
(2, 'The Journey of Transformation\n\n Seeing {Child\'s Name} transform into a confident and disciplined young individual has been one of my proudest moments as a parent. Every step, every challenge faced at #MasteryMartialArts, has contributed to this change. Our love and admiration for Mastery grow with each class. \n\nP.S. If you\'re curious about this transformational journey, I\'d love to sponsor you! Try 2 weeks for FREE here:', '392d'),
(3, 'Pride and Progress\n\nWitnessing {Child\'s Name} grow into a resilient and focused individual has filled our hearts with pride. Mastery Martial Arts has not just taught techniques but life values. We\'re immensely grateful for this bond with Mastery.\n\nP.S. If you\'re curious about this transformational journey, I\'d love to sponsor you! Try 2 weeks for FREE here:', '392d'),
(4, 'Mastery\'s Magic\n\nIt\'s been astonishing to see {Child\'s Name}\'s journey from being hesitant to a passionate martial artist. My pride as a parent knows no bounds! Mastery Martial Arts holds a special place in our hearts for making this possible. \n\nP.S. If you\'re curious about this transformational journey, I\'d love to sponsor you! Try 2 weeks for FREE here:', '392d'),
(5, 'The Mastery Effect\n\nThe joy of seeing {Child\'s Name} evolve into a disciplined and self-assured individual is indescribable. All thanks to the nurturing environment at Mastery Martial Arts. It\'s more than a class; it\'s a family we cherish.\n\nP.S. If you\'re curious about this transformational journey, I\'d love to sponsor you! Try 2 weeks for FREE here:\n', '392d'),
(6, 'Unveiling Potential\n\nIt\'s heartwarming to watch {Child\'s Name} embrace challenges and flourish into a determined martial artist. My parental pride is overflowing! Mastery Martial Arts has truly been our guiding star on this transformative journey.\n\nP.S. If you\'re curious about this transformational journey, I\'d love to sponsor you! Try 2 weeks for FREE here\n', '392d'),
(7, 'Beyond Expectations\n\nFrom day one to today, the metamorphosis in {Child\'s Name}\'s attitude and skills is astounding. As a parent, witnessing this growth has been my pride and joy. Our gratitude to Mastery Martial Arts is boundless!\n\nP.S. If you\'re curious about this transformational journey, I\'d love to sponsor you! Try 2 weeks for FREE here:', '3920'),
(8, 'The Mastery Milestones\n\nEvery belt, every accolade, every challenge conquered  witnessing {Child\'s Name}\'s achievements at #MasteryMartialArts swells my heart with pride. It\'s clear we found our second home at Mastery.\n\nP.S. If you\'re curious about this transformational journey, I\'d love to sponsor you! Try 2 weeks for FREE here:', '3920'),
(9, 'The Mastery Chronicle\n\nIt\'s been nothing short of incredible to see {Child\'s Name} bloom into a confident and poised martial artist. My heart brims with pride at each step. Mastery has been our compass, guiding us through this enriching journey.\n\nP.S. If you\'re curious about this transformational journey, I\'d love to sponsor you! Try 2 weeks for FREE here:\n', '392d'),
(10, 'The Mastery Legacy\n\nFrom the initial tentative steps to the confident strides now  {Child\'s Name}\'s journey has been an inspiration. My chest swells with pride at each achievement. Our unwavering love for Mastery grows with each day.\n\nP.S. If you\'re curious about this transformational journey, I\'d love to sponsor you! Try 2 weeks for FREE here:', '3920'),
(15, ' Thrilled to announce {Child\'s Name}\'s new journey with Mastery Martial Arts!   \n\n The classes? Structured, fun, and oh-so engaging! It\'s clear why parents are talking. \n Every session is a chance to watch  {Child\'s Name} thrive mentally, emotionally, and physically. \n And talk about a confidence boost! A few classes in and the transformation is undeniable. \n Hats off to the instructors  their knack for connecting, leading, and motivating is top-notch. \n\n Parents, if you\'re looking for something special for your kids, Mastery Martial Arts might just be it.   \n\nStay tuned for more of our adventures!', '392d');
